// networth.module.ts

import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { ReactiveFormsModule, FormsModule } from '@angular/forms';
import { RouterModule, Routes } from '@angular/router';

// Main Component
import { NetWorthComponent } from './networth.component';

// Modal Components
import { AddAssetModalComponent } from './components/add-asset-modal/add-asset-modal.component';
import { AddLoanModalComponent } from './components/add-loan-modal/add-loan-modal.component';
import { LoanCalculatorModalComponent } from './components/loan-calculator-modal/loan-calculator-modal.component';

const routes: Routes = [
  { path: '', component: NetWorthComponent }
];

@NgModule({
  declarations: [
    NetWorthComponent,
    AddAssetModalComponent,
    AddLoanModalComponent,
    LoanCalculatorModalComponent
  ],
  imports: [
    CommonModule,
    ReactiveFormsModule,
    FormsModule,
    RouterModule.forChild(routes)
  ]
})
export class NetWorthModule { }
